import ExpenseItem from "./components/Expenses/ExpenseItem";

const App = () => {
  const expenses = [
    {
      id: "e1",
      title: "bought veggies",
      date: new Date(2022, 5, 20),
      amount: 237,
    },
    {
      id: "e2",
      title: "bought books",
      date: new Date(2022, 3, 20),
      amount: 1499,
    },
    {
      id: "e3",
      title: "Fuel ",
      date: new Date(2022, 5, 28),
      amount: 4000,
    },
    {
      id: "e4",
      title: " Subsciption charges",
      date: new Date(2022, 1, 20),
      amount: 1200,
    },
  ];
  return (
    <div>
      <ExpenseItem expenses={expenses} />
    </div>
  );
};

export default App;
